import { Card } from "primereact/card";
import { useEffect, useRef, useState } from "react";

const Details = (props) => {
  const params =
    props["quest"] === undefined ||
    props["quest"] === null ||
    props === undefined ||
    props === null 
  // props["location"] === undefined ||
  // props["location"] === null
  // props["NPC"] === undefined
  // props["NPC"] === null ||
  // props["item"] === undefined ||
  // props["item"] === null
  console.log(props.location, props.NPC)

  const propsName = params
    ? (props = "No Selection")
    : props["quest"]["name"];

  const propsDetail = params
    ? (props = "")
    : props["quest"]["detail"];

  return (
    <>
      <h1>Details</h1>
      <Card
        title={propsName}
        style={{ width: "25rem", marginBottom: "2em" }}
      >
        <p className="m-0" style={{ lineHeight: "1.5" }}>
          {propsDetail}
        </p>
      </Card>
    </>
  );
};

export default Details;
